import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/CasePage.css'; // Import the CSS file

const caseData = [
  { id: '67ff0e49173e97a1a082e4b7', name: 'Corsair 5000D Airflow', image: 'data:image/jpeg;base64,', slug: 'corsair-5000d-airflow' },
  { id: '67ff0e49173e97a1a082e4b8', name: 'Lian Li O11 Dynamic EVO', image: 'data:image/jpeg;base64,', slug: 'lian-li-o11-dynamic-evo' },
  { id: '67ff0e49173e97a1a082e4b9', name: 'Fractal Design Meshify 2', image: 'data:image/jpeg;base64,', slug: 'fractal-design-meshify-2' },
  { id: '67ff0e49173e97a1a082e4ba', name: 'NZXT H7 Flow', image: 'data:image/jpeg;base64,', slug: 'nzxt-h7-flow' },
  { id: '67ff0e49173e97a1a082e4bb', name: 'be quiet! Silent Base 802', image: 'data:image/jpeg;base64,', slug: 'be-quiet-silent-base-802' },

];

const CasePage = () => {
  return (
    <div className="case-page">
      <h2>Browse Cases</h2>
      <div className="case-grid">
        {caseData.map((pcCase) => (
          <Link to={`/product/${pcCase.id}`} key={pcCase.id} className="case-card">
            <img src={pcCase.image} alt={pcCase.name} />
            <h3>{pcCase.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default CasePage;
